script: |
  super -f text -I q7096.spq | sort > q7096.out

inputs:
  - name: q7096.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) WHERE + - ( + ( col0 ) ) / - + ( + + col1 ) * - col0 - ( - + col0 ) + - + 92 * col0 BETWEEN + - ( - - col1 ) * - col0 + - col0 AND 50 - + col2 + - - ( CAST ( NULL AS INTEGER ) );
  - name: tab2

outputs:
  - name: q7096.out
    data: |
